contract SaleAggrement{
    uint value;
    address payable buyer;
    address payable seller;
    enum State { created, locked, Inactive}
    State public state;

    constructor()  payable{
        seller=payable(msg.sender);
        value=msg.value;
        state=State.created;
    }
}

